'use strict';
//@@DocBrief("The interface of the hosts receiver callback")
class HostsReceiverCallback {
    command;
    onHostsReceived(hosts) {
        this.command.notifyOnHostsReceived(hosts);
    }
    onError(error) {
        this.command.notifyOnErrorWhenHostsReceived(error);
    }
    static create(command) {
        let hostsReceiverCallback;
        hostsReceiverCallback = new HostsReceiverCallback();
        hostsReceiverCallback.command = command;
        return hostsReceiverCallback;
    }
}
module.exports = HostsReceiverCallback
